import Home from '@/pages/Home'
import Search from '@/pages/Search'
import Login from '@/pages/Login'
import Register from '@/pages/Register'

export default [
    {
        path: '/',
        redirect: '/home'
    },
    {
        name: 'home',
        path: '/home',
        component: Home,
        meta: { isShow: true },
    },
    {

        path: '/search/:shopInfo',
        component: Search,
        meta: { isShow: true },
    },
    {
        path: '/login',
        component: Login,
        meta: { isShow: false },
    },
    {
        path: '/register',
        component: Register,
        meta: { isShow: false },
    },
]
